variableGet.description:
Retrieves a variable from the variable store (set by #variableGet). Used when simple internal state is absolutely necessary.

rs2: result = #variableGet(key="unique key");<br>
LevrJS: result = variableGet.call(this,"unique key");

variableSet.description:
Places a variable into a local store referenced by 'key'. Use when in-memory state is absolutely required.

rs2: obj.variableSet(key="unique key");<br>
LevrJS: variableSet.call(this,obj,"unique key");

createDirectory.description:
Creates a directory. Will throw exception if the directory exists, use alongside fileExists to prevent this. Will not create parent directories.

rs2: #createDirectory(path="Relative or Full Path to directory");<br>
LevrJS: createDirectory.call(this,"Relative or Full Path to directory");

fileDelete.description:
Deletes a file or directory. Will return false if file did not exist or if the file could not be deleted. Returns true if the file is deleted.

rs2: #fileDelete(path="Relative or Full Path to directory");<br>
LevrJS: fileDelete.call(this,"Relative or Full Path to directory");

fileExists.description:
Returns true if the file or directory located at the path exists.

rs2: result = #fileExists(path="Relative or Full Path to directory");<br>
LevrJS: fileExists.call(this,"Relative or Full Path to directory");

fileToBase64.description:
Converts one or more files to a JSON Object with the file's name as the key, and the file's data as a base64 encoded string as the value.

{"filename":"Base64 encoded file data"}

rs2: obj = obj.fileToBase64(); levrJs: obj = fileToBase64.call(this,obj);

filename.description:
Returns the filename of a file.

rs2: obj = obj.filename(); levrJs: obj = filename.call(this,obj); 
rs2: obj = obj.fileName(); levrJs: obj = fileName.call(this,obj);

filepath.description:
Zips either a Map<String,?>, a JSONObject composed of "filename":"UTF-8 encoded string" or a JSONArray of files.
